import React from 'react';

function Dashboard() {
  return (
    <div className="text-center">
      <h2 className="text-2xl font-semibold text-[#6B21A8] mb-2">Welcome Team</h2>
      <p className="text-gray-600">This is a demo dashboard for the assignment submission.</p>
    </div>
  );
}

export default Dashboard;
